import React from 'react';
import { AppBar, Toolbar, Typography, Button, Box } from '@mui/material';
import { Link, useNavigate } from 'react-router-dom';
import Cookies from 'js-cookie';

const Navbar = ({ isLoggedIn, setIsLoggedIn, isAdmin }) => {
    const navigate = useNavigate();

    const handleLogout = () => {
        Cookies.remove('token');
        Cookies.remove('admin');
        setIsLoggedIn(false);
        navigate('/');
    };

    return (
        <AppBar position="static">
            <Toolbar>
                <Typography variant="h6" sx={{ flexGrow: 1 }}>
                    {isAdmin ? 'Admin Cricket Auction' : 'Bidder Cricket Auction'}
                </Typography>
                <Box>
                    {isAdmin ? (
                        <>
                            <Button color="inherit" component={Link} to="/admin-dashboard">
                                Dashboard
                            </Button>
                            <Button color="inherit" component={Link} to="/players">
                                Players
                            </Button>
                            <Button color="inherit" component={Link} to="/auctions">
                                Auctions
                            </Button>
                        </>
                    ) : (
                        <>
                            <Button color="inherit" component={Link} to="/bidder-dashboard">
                                Dashboard
                            </Button>
                            <Button color="inherit" component={Link} to="/auction-page">
                                Auctions
                            </Button>
                        </>
                    )}
                    {!isLoggedIn ? (
                        <>
                            <Button color="inherit" component={Link} to="/admin-login">
                                Admin Login
                            </Button>
                            <Button color="inherit" component={Link} to="/bidder-login">
                                Bidder Login
                            </Button>
                        </>
                    ) : (
                        <Button color="inherit" onClick={handleLogout}>
                            Logout
                        </Button>
                    )}
                </Box>
            </Toolbar>
        </AppBar>
    );
};

export default Navbar;
